import { createContext, useState, useEffect } from "react";
import SpecialHeader from "../components/Common-components/SpecialHeader";
import CategoryIpads from "../components/Common-components/CategoryIpads";
import Skeleton from "../components/Skeleton/Skeleton";
import ProductCard from "../components/ProductCard";
import NotFoundPage from "../components/Common-components/NotFoundPage";

function Ipads(properties) {
  const productToken = "iPad";

  useEffect(() => {
    properties.setToken(productToken);
  }, [productToken, properties.setToken]);

  return (
    <>
      <SpecialHeader></SpecialHeader>
      <div className="mainPhoneContainer">
        <div className="phoneContainer">
          <div className="categoryIphones">
            <CategoryIpads></CategoryIpads>
          </div>
          <div className="iphoneSection">
            <div className="iphoneContainer">
              {console.log(properties.data == null)}
              {console.log(properties.data)}
              {properties.isLoading ? [... new Array(6)].map((_, index) => <Skeleton></Skeleton>) : properties.data.length != 0 ? properties.data.map((obj) => <ProductCard key={obj.id} {...obj}></ProductCard>) : properties.data.length == 0 ? <NotFoundPage></NotFoundPage> : null}
            </div>
            <div className="pagination">
              {properties.totalPages !== 0 ? [...new Array(properties.totalPages)].map((obj, index) => <button onClick={() => properties.onCLickPage(index)}>{index + 1}</button>) : null}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Ipads;
